import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import HeroCarousel from '../components/HeroCarousel';
import './Destination.css';

const Destination = () => {
  const [cars, setCars] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchCars();
  }, []);

  const fetchCars = async () => {
    try {
      const response = await axios.get('/api/cars');
      setCars(response.data);
    } catch (error) {
      console.error('Error fetching cars:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="destination-page">
      <HeroCarousel title="Destination" subtitle="Home ‚Üí Destination" />

      <div className="destination-content">
        <div className="container">
          <div className="destination-main">
            <div className="destination-list">
              {loading ? (
                <div className="loading">Loading destinations...</div>
              ) : (
                <div className="destination-cards">
                  {cars.map((car) => (
                    <div key={car._id} className="destination-card">
                      <img src={car.image} alt={car.name} />
                      <div className="card-content">
                        <h3>{car.name}</h3>
                        <p>{car.brand} {car.model} ({car.year})</p>
                        <div className="card-details">
                          <span>üë• {car.seats} Seats</span>
                          <span>‚öôÔ∏è {car.transmission}</span>
                          <span>‚õΩ {car.fuelType}</span>
                        </div>
                        <div className="card-price">
                          {car.price60min ? (
                            <>
                              <span className="price">{car.price60min} {car.currency || 'AED'}</span>
                              <span className="price-label">/60min</span>
                            </>
                          ) : (
                            <>
                              <span className="price">{car.pricePerDay} {car.currency || 'AED'}</span>
                              <span className="price-label">/day</span>
                            </>
                          )}
                        </div>
                        <Link to={`/car/${car._id}`} className="btn btn-primary">
                          Book Now ‚Üí
                        </Link>
                      </div>
                    </div>
                  ))}
                </div>
              )}
            </div>

            <div className="destination-sidebar">
              <div className="sidebar-section">
                <h3>Basic Information</h3>
                <div className="info-list">
                  <div className="info-item">
                    <span className="info-label">Destination:</span>
                    <span className="info-value">Various Locations</span>
                  </div>
                  <div className="info-item">
                    <span className="info-label">Visa Requirements:</span>
                    <span className="info-value">Not Required</span>
                  </div>
                  <div className="info-item">
                    <span className="info-label">Language:</span>
                    <span className="info-value">English</span>
                  </div>
                  <div className="info-item">
                    <span className="info-label">Currency Used:</span>
                    <span className="info-value">AED</span>
                  </div>
                  <div className="info-item">
                    <span className="info-label">Total Vehicles:</span>
                    <span className="info-value">{cars.length} Available</span>
                  </div>
                  <div className="info-item">
                    <span className="info-label">Per Hour:</span>
                    <span className="info-value">From 100 AED</span>
                  </div>
                </div>
              </div>

              <div className="sidebar-section">
                <h3>Recent Posts</h3>
                <div className="recent-posts">
                  <div className="post-item">
                    <span className="post-date">22/8/2025</span>
                    <p>Harmony With Nature Of Belgium Tour And Travel</p>
                  </div>
                  <div className="post-item">
                    <span className="post-date">23/6/2025</span>
                    <p>Exploring The Green Spaces Of Realar Residence</p>
                  </div>
                </div>
              </div>

              <div className="sidebar-section">
                <h3>Popular Tags</h3>
                <div className="tags">
                  <span className="tag">Tour</span>
                  <span className="tag">Adventure</span>
                  <span className="tag">Travel</span>
                  <span className="tag">Hotel</span>
                  <span className="tag">Luxury</span>
                  <span className="tag">Explore</span>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Destination;
